import React from 'react'
import productos from '../produtos.json'
import Card from '../components/card'

function Listado(){
    return (
        <div className = "container">
            <form>
                <div className = "row">
                    {productos.map((datos)=>{
                        return <Card data = {datos} />
                    })}   
                <button
                    type = "submit"
                    className = "btn btn-primary center">
                    Solicitar
                </button>                                  
                </div>           
                <div></div>    
            </form>


        </div>

    )
}

export default Listado
